import { useState } from "react";
import "./App.css";
import TodoList from "./TodoList";

function App() {
  const [todos, setTodos] = useState([
    {
      id: Math.random(),
      text: "Learn JS",
      isComplated: false,
    },
    {
      id: Math.random(),
      text: "Learn React",
      isComplated: false,
    },
    {
      id: Math.random(),
      text: "Learn English",
      isComplated: false,
    },
  ]);

  return (
    <div className="App">
      <TodoList />
    </div>
  );
}

export default App;
